import React, { useEffect } from 'react'
import { Row, Col, Container, Card, Buttom, Badge } from 'react-bootstrap'
import { useDispatch, useSelector } from 'react-redux'
import { StartObtenerTodos } from '../../actions/Todos'

export const HomePage = () => {

    const dispatch = useDispatch()
    const { toDos, token }= useSelector(state => state)


    useEffect(() => {
        dispatch( StartObtenerTodos( token ))
    }, [])

    console.log(toDos)






    return (
        <Row style={{ height: '90vh' }} class='d-flex justify-content-center aling-items-center'>
            <Col style={ styles.col } className='d-flex justify-content-center'>
                <Container>

                    <div style={{ textAlign: 'center', margin: '1rem', borderBottom: '1px solid black' }}>
                        <h4>Pendientes</h4>
                    </div>

                    <Row>


                        {
                            [1,2,3,4,5,6,7,8].map( item => (
                                <Card style={{ width: '100%', margin: '1rem 0' }} key={ item } bg='white    '>
                                    <Card.Body>
                                        <Card.Subtitle className="mb-2 text-muted">Card Subtitle</Card.Subtitle>
                                        <Card.Title>Card Title</Card.Title>
                                        <Card.Text>
                                        Some quick example text to build on the card title and make up the bulk of
                                        the card's content.
                                        </Card.Text>
                                        <Badge style={ styles.badge } className='m-2'>Eliminar</Badge>{"   "} 
                                        <Badge style={ styles.badge }>Listo</Badge>
                                    </Card.Body>
                                    <Card.Footer style={{ textAlign: 'right'}}>
                                        <Card.Text>Completada hace 4 dias</Card.Text>
                                    </Card.Footer>
                                </Card>
                            ))
                        }
                    </Row>

                </Container>
            </Col>
        </Row>
    )
}







const styles = {
    col: {
        backgroundColor: 'white',
        borderRadius: '5px',
        minHeigth: '85vh',
        margin: '10px',
        overflowY: 'scroll',
        maxHeight: '100%'
    },
    badge: {
        cursor: 'pointer'
    }
}
